import React from 'react'
import { Menu } from 'antd';
// import { UploadOutlined, UserOutlined, VideoCameraOutlined } from '@ant-design/icons';
export default function Sidebar(props) {
    const renderItem = (role) => {
        if (role === 'admin') {
            return (
                <Menu theme='dark'>
                    <Menu.Item>admin 1</Menu.Item>
                    <Menu.Item>admin 2</Menu.Item>
                </Menu>
            )
        } else {
            return (
                <Menu theme='dark'>
                    <Menu.Item>other 1</Menu.Item>
                    <Menu.Item>other 2</Menu.Item>
                    <Menu.Item>other 2</Menu.Item>
                    <Menu.Item>other 2</Menu.Item>
                </Menu>
            )
        }
    }
    return (
        renderItem(props.role)
    )
}
